    def cumulativeCountAttr = flowFile.getAttribute('cumulative_count')

    // Log the extracted cumulative_count
    log.info("Extracted cumulative_count from attribute: ${cumulativeCountAttr}")

    // Retrieve the TotalObjectCount attribute from the flowfile
    def totalObjectCount = flowFile.getAttribute('TotalObjectCount')

    // Check if cumulativeCountAttr and TotalObjectCount are not null or empty
    if (cumulativeCountAttr != null && !cumulativeCountAttr.isEmpty() &&
        totalObjectCount != null && !totalObjectCount.isEmpty()) {

        // Convert cumulative_count and TotalObjectCount to integers
        def incomingData = cumulativeCountAttr.toInteger()
        def totalObjectCountInt = totalObjectCount.toInteger()

        // Initialize startLinkingIs with a default value
        def startLinkingIs = 'false'

        // Check if incomingData (cumulative_count) is equal to TotalObjectCount
        if (incomingData == totalObjectCountInt) {
            startLinkingIs = 'true'
        }

        // Update the flowfile attributes
        flowFile = session.putAttribute(flowFile, 'ObjectBeingProcessed', incomingData.toString())
        flowFile = session.putAttribute(flowFile, 'startLinkingIs', startLinkingIs)

        // Log updated attributes
        log.info("Updated ObjectBeingProcessed: ${incomingData}")
        log.info("Updated startLinkingIs: ${startLinkingIs}")

        // Transfer the flowfile to the next processor (REL_SUCCESS)
        session.transfer(flowFile, REL_SUCCESS)
    } else {
        log.warn("The cumulative_count or TotalObjectCount attribute is null or empty.")
        // Transfer to failure relationship
        session.transfer(flowFile, REL_FAILURE)
    }
} else {
    log.warn("FlowFile is null.")
}

import org.apache.nifi.processor.io.StreamCallback
import org.apache.nifi.flowfile.FlowFile
import groovy.json.JsonSlurper
import groovy.json.JsonBuilder

// Define the StreamCallback to read and write JSON data
class JsonMergeCallback implements StreamCallback {

    @Override
    void process(InputStream inputStream, OutputStream outputStream) throws IOException {
        def jsonSlurper = new JsonSlurper()
        def data = jsonSlurper.parse(inputStream)

        // Create a map to hold merged data
        def resultMap = [:]

        // Process each item
        data.each { item ->
            def id = item."neuWaveLegacyID"

            // Check if the NeuWave Legacy ID already exists in the result map
            if (!resultMap.containsKey(id)) {
                // If not, add the item as is
                resultMap[id] = item
            } else {
                // If it exists, merge the "Decomposes From" and "Decomposes To" fields as strings
                resultMap[id]."Decomposes From" = mergeAsStringOrNull(resultMap[id]."Decomposes From", item."Decomposes From")
                resultMap[id]."Decomposes To" = mergeAsStringOrNull(resultMap[id]."Decomposes To", item."Decomposes To")
            }
        }

        // Convert the values from the map into an array (list) of JSON objects
        def finalResult = resultMap.values().collect { new JsonBuilder(it).toString() }

        // Ensure the output is in an array format
        def outputJson = "[" + finalResult.join(",") + "]"

        // Write the output JSON to the OutputStream
        outputStream.write(outputJson.getBytes('UTF-8'))
    }

    // Helper method to merge values into a single "/"-separated string or keep as null
    private String mergeAsStringOrNull(Object existingValue, Object newValue) {
        def existingList = existingValue instanceof List ? existingValue : [existingValue]
        def newList = newValue instanceof List ? newValue : [newValue]
        def combined = (existingList + newList).findAll { it != null } // Remove null values
        return combined.isEmpty() ? null : combined.join("/")
    }
}

// Main processor logic
try {
    // Get the flow file (in NiFi, this will be automatically passed in)
    FlowFile flowFile = session.get()
    if (!flowFile) return

    // Process the FlowFile using the callback
    flowFile = session.write(flowFile, new JsonMergeCallback())

    // Transfer the FlowFile to the success relationship
    session.transfer(flowFile, REL_SUCCESS)
} catch (Exception e) {
    // If there's an error, log it and transfer to the failure relationship
    log.error("Error processing FlowFile", e)
    session.transfer(flowFile, REL_FAILURE)
}

