import org.apache.nifi.processor.io.InputStreamCallback
import org.apache.nifi.flowfile.FlowFile
import groovy.json.JsonSlurper

def session = session
if (session == null) return

// Get the incoming flowfile
def flowfile = session.get()
if (flowfile == null) return

try {
    // Read the content of the flowfile
    def content = new StringWriter()
    session.read(flowfile, new InputStreamCallback() {
        @Override
        void process(InputStream inputStream) throws IOException {
            content << inputStream.text
        }
    })

    // Parse the content as JSON
    def jsonSlurper = new JsonSlurper()
    def jsonContent = jsonSlurper.parseText(content.toString())

    // Extract attributes from flowfile
    def notFoundWorkItems = flowfile.getAttribute('notFoundWorkItems')

    // Check conditions
    def dataArray = jsonContent?.data ?: []

    def bothBodyAndStringExists = (dataArray && notFoundWorkItems)
    def bodyEmptyAndStringExists = (!dataArray && notFoundWorkItems)
    def bodyExistsAndStringEmpty = (dataArray && !notFoundWorkItems)
    def bothNotExists = (!dataArray && !notFoundWorkItems)

    // Update attributes
    flowfile = session.putAttribute(flowfile, "BodyEmptyAndStringExists", bodyEmptyAndStringExists.toString())
    flowfile = session.putAttribute(flowfile, "BodyExistsAndStringEmpty", bodyExistsAndStringEmpty.toString())
    flowfile = session.putAttribute(flowfile, "bothBodyAndStringExists", bothBodyAndStringExists.toString())
    flowfile = session.putAttribute(flowfile, "BothNotExists", bothNotExists.toString())

    // Transfer flowfile to next processor
    session.transfer(flowfile, REL_SUCCESS)
} catch (Exception e) {
    // Log error and transfer to failure
    log.error("Failed to process flowfile: ${e.message}", e)
    session.transfer(flowfile, REL_FAILURE)
}

