try {
    // Read the content of the flowfile
    def inputStream = session.read(flowFile)
    def jsonSlurper = new JsonSlurper()
    def incomingData = jsonSlurper.parse(inputStream)
    inputStream.close()

    // Initialize result structure
    def result = [data: []]

    // Process "Decomposes From" array if present
    if (incomingData["Decomposes From"]) {
        incomingData["Decomposes From"].each { item ->
            result.data << [
                type: "linkedworkitems",
                attributes: [role: "decomposedFrom"],
                relationships: [
                    workItem: [
                        data: [
                            type: "workitems",
                            id: "NeuwaveReqTemplate/${item.workitemID}"
                        ]
                    ]
                ]
            ]
        }
    }

    // Process "Decomposes To" array if present
    if (incomingData["Decomposes To"]) {
        incomingData["Decomposes To"].each { item ->
            result.data << [
                type: "linkedworkitems",
                attributes: [role: "Decomposes To"],
                relationships: [
                    workItem: [
                        data: [
                            type: "workitems",
                            id: "NeuwaveReqTemplate/${item.workitemID}"
                        ]
                    ]
                ]
            ]
        }
    }

    // Create the result JSON
    def outputJson = JsonOutput.toJson(result)

    // Determine if the JSON is empty and set the "isEmpty" attribute
    def isEmpty = result.data.isEmpty() ? "true" : "false"

    // Write the resulting JSON back to the flowfile
    flowFile = session.write(flowFile, { outputStream ->
        outputStream.write(outputJson.getBytes("UTF-8"))
    } as OutputStreamCallback)

    // Prepare flowfile attributes to be updated
    def flowFileAttributes = [:]

    // Set additional attributes from incomingData if present
    if (incomingData.linkto) {
        flowFileAttributes["linkto"] = incomingData.linkto
    }
