   //     flowFileAttributes["notFoundWorkItems"] = incomingData.notFoundWorkItems
  //  }

    // Add the "isEmpty" attribute (this is the key part of your request)
    flowFileAttributes["isEmpty"] = isEmpty

    // Update the flowfile attributes with the new values
    flowFile = session.putAllAttributes(flowFile, flowFileAttributes)

    // Transfer the flowfile to success
    session.transfer(flowFile, REL_SUCCESS)
} catch (Exception e) {
    log.error("Error processing flowfile", e)
    session.transfer(flowFile, REL_FAILURE)
