import org.apache.nifi.processor.io.StreamCallback
import groovy.json.JsonSlurper
import groovy.json.JsonOutput

// Define a global variable
 def startLinkingIs = "false"

flowFile = session.get()
if (!flowFile) return

def startLinkingIsValue // To store the calculated value for the attribute

flowFile = session.write(flowFile, { inputStream, outputStream ->
    // Parse the incoming JSON
    def jsonSlurper = new JsonSlurper()
    def incomingJson = jsonSlurper.parse(inputStream)

    // Get attributes and fields with null-safe handling
    def fragmentCount = flowFile.getAttribute('fragment.count')?.toInteger() ?: 0 // Default to 0 if null
    def existsObjectCount = incomingJson['ExistsObjectCount'] ?: 0 // Default to 0 if null
    def cumulativeCount = incomingJson['cumulative_count'] ?: 0 // Default to 0 if null

    // Perform the calculation and comparison
    def difference = fragmentCount - existsObjectCount

    if (fragmentCount == cumulativeCount) 
        {
          startLinkingIs = "true"
        }
     else  {
         startLinkingIs = (difference == cumulativeCount)
           }
    // Update the JSON content
    incomingJson['startLinkingIs'] = startLinkingIs

    // Store the value for later use as an attribute
    startLinkingIsValue = startLinkingIs

    // Write the updated JSON back to the flow file
    outputStream.write(JsonOutput.toJson(incomingJson).bytes)
} as StreamCallback)

// Set the calculated 'startLinkingIs' value as a flow file attribute
flowFile = session.putAttribute(flowFile, 'startLinkingIs', startLinkingIsValue.toString())

// Transfer the flow file to the success relationship
session.transfer(flowFile, REL_SUCCESS)

import groovy.json.JsonSlurper
