    flowFileContent = inputStream.text
    def jsonParser = new JsonSlurper()
    def records = jsonParser.parseText(flowFileContent)

    // Group records by 'neuWaveLegacyID'
    def groupedRecords = records.groupBy { it.neuWaveLegacyID }

    // Iterate through grouped records to process
    groupedRecords.each { id, recordGroup ->
        // Find the first non-null Type value within the group
        def typeValue = recordGroup.find { it.Type != null }?.Type

        if (typeValue) {
            // Assign the found Type value to all records with null Type
            recordGroup.each { record ->
                if (record.Type == null) {
                    record.Type = typeValue
                }
            }
        }
    }

    // Write the updated JSON back to output
    def updatedJson = JsonOutput.toJson(records)
    outputStream.write(updatedJson.getBytes("UTF-8"))
} as StreamCallback)

